import React from "react";
import cs2 from "../../img/cs2.webp";
import Comment from "../common/Coment";
import Image from "../common/Image";
import Info from "../common/Info";
import Video from "../common/Video";
import style from "../../css/Subpage.module.css"

const Cs2: React.FC = () =>{
    return(
        <div>
            <Image className="main" src={cs2}/>
            <Comment className="comment" sectionTitle="紹介">
                <p>テキストテキストテキストテキストテキスト</p>
                <p>テキストテキストテキストテキストテキスト</p>
                <p>テキストテキストテキストテキストテキスト</p>
                <p>テキストテキストテキストテキストテキスト</p>
                <p>テキストテキストテキストテキストテキスト</p>
            </Comment>
            <Video width="800" height="500" src="https://www.youtube.com/embed/vvma9W-h7dE?si=jl8YYFr2DJp3LvYT" title="YouTube video player" frameBorder={0} allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerPolicy="strict-origin-when-cross-origin"></Video>
            <Info className={style.info}>
                <p>テキストテキストテキストテキストテキスト</p>
                <p>テキストテキストテキストテキストテキスト</p>
                <p>テキストテキストテキストテキストテキスト</p>
                <p>テキストテキストテキストテキストテキスト</p>
                <p>テキストテキストテキストテキストテキスト</p>
            </Info>
        </div>
    )
}

export default Cs2;
